import React from 'react';
import google_logo from "/Applications/Desktop/personal_projects/mra/movie-junkie/login-page/src/google_logo.svg";
import arrow from "/Applications/Desktop/personal_projects/mra/movie-junkie/login-page/src/arrow.svg";
import { GoogleLogin } from '@react-oauth/google';
import './App.css';

const clientId = '139631261134-skkvra84c3hhq05914re7vgqlleecavt.apps.googleusercontent.com';

function App() {
  return (
    <div className='login-component'>
      {/* Login Form */}
      <form>
        <h1>SIGN IN</h1>
        <input className='email' type='email' name='email' placeholder='Email' required />
        <input className='password' type='password' name='password' placeholder='Password' required />
        <button type="submit" className="btn" id="btn">
          <img src={arrow} alt="arrow" className="arrow-icon" />
        </button>
      </form>

      {/* Divider */}
      <div className="divider">
        <span>OR</span>
      </div>

      <GoogleLogin
        clientId={clientId}
        render={(renderProps) => (
          <button className="google-btn" onClick={renderProps.onClick} disabled={renderProps.disabled}>
            <img src={google_logo} alt="google logo" className="google-icon" /> Log in with Google
          </button>
        )}
        buttonText="Login"
        onSuccess={(response) => console.log(response)}
        onError={(error) => console.log('Login failed: ', error)}
      />

      <p className='create-account'>Not a member? <a href="http://localhost:3000/">Sign up now</a></p>
    </div>
  );
}

export default App;
